import{_ as t,c as a,o,j as e,a as i}from"./chunks/framework.Cv3JQ2Vj.js";const B=JSON.parse('{"title":"一年就这么过去了","description":"","frontmatter":{"title":"一年就这么过去了","date":"2017-06-19T00:00:00.000Z"},"headers":[],"relativePath":"posts/yi-nian-jiu-zhe-me-guo-qu-le.md","filePath":"posts/yi-nian-jiu-zhe-me-guo-qu-le.md"}'),s={name:"posts/yi-nian-jiu-zhe-me-guo-qu-le.md"},n=e("h1",{id:"一年就这么过去了",tabindex:"-1"},[i("一年就这么过去了 "),e("a",{class:"header-anchor",href:"#一年就这么过去了","aria-label":'Permalink to "一年就这么过去了"'},"​")],-1),r=e("p",null,"今天考完了专业课的期末考试，不仅是大一的最后一节课了，同时也是ZTZ的最后一节课。时光真的过得好快、其他的也不想多说，时间也不早了。挺累的坐的半天的车(早上考完了、下午就坐车回家了、现在蹭着旁边网吧的wifi敲字)就只总结一下今天的期末考试吧。今天的期末考试总的来说挺简单的。三个送分题——简述ADO.net五大对象、简述C#四个访问修饰符、简述C#面向对象的三大特征、还有一题就是实践题——连接SQL实现登录判断、实现注册、实现模糊查询、实现构造函数传值-右键弹出新窗体、在新窗体中修改数据、关闭后主窗体刷新，这也要比我昨天练手的简单得多，而且今天考试的时候鬼使神差的一上手就搭建好了三层架构，然后用三层架构写的、但最后还是觉得很多地方没有做完美、没有给自己一个满意的答卷、总共有两点挺可惜的，也怪自己吧。第一点是在简述访问修饰符public就写了一个公开访问、后面的忘了写描述、第二点、忘了写防SQL注入的BUG、刚开始看题目有登陆功能的时候就想着要防SQL注入，后来写DBhelper类的时候，方法都写完了才记起来，然后一想还是把功能都实现了再加上去吧。结果最后忘了、就这么忘了、剩下还有那么多的时间就在搞其他的玩、给旁边抄。考完了后坐在车上的时候才记起来。总觉得挺不满意的、虽然不是考点、写了或许也不会加分、不写也不会扣分、但想着自己的程序有BUG还是觉得挺不爽的。",-1),c=[n,r];function l(d,u,p,_,h,m){return o(),a("div",null,c)}const x=t(s,[["render",l]]);export{B as __pageData,x as default};
